import React from 'react';
// import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className ="App">
    // <p>&nbsp;</p>

    <input type="text" aria-required="true" size="200" value=""
     name="Search Repo" placeholder="Search Repo" style={{"height" : "1500px;", "width" : "100"}}

/>



    <button style={{"height" : "80", "width" : "30"}}>Search</button>


</div>

  );
}

export default App;
